let validWaves = ["1","1A","1C","1S","1E","2","2A","2S","3","3A","3A35","3C","4","4A","5","5A","0",];
cardDB = cardDB.filter((e)=>{
	return validWaves.indexOf(e.wave)!=-1;
});

let downloadlist = [];
for(let card of cardDB){
	if(card.modes.length==0){
		downloadlist.push([card.cardId,1,card.cardName]);
	}
}
console.log(downloadlist);

function downloadCard(index){
	let id = downloadlist[index][0];
	let mode = downloadlist[index][1];
	let uri = `https://transformers.cards/cardimage?card=${id}&mode=${mode}&full=1`;
	request(uri).pipe(fs.createWriteStream(`${id}.jpg`)).on('close', ()=>{
		console.log(`Downloaded (${index}) ${downloadlist[index][2]}`);
		setTimeout(()=>{
			downloadCard(index+1);
		},(Math.random()*10000));
	});
}

downloadCard(0);

